	add("beardism", "{\"term\":\"beardism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|beard|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Prejudice against bearded people\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Allan Peterkin, \u0027One Thousand Beards: A Cultural History of Facial Hair\u0027 (page 147\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Meanwhile, early in 2001, the Equal Opportunities Branch of Britain\u0027s Home Office conducted \u0026quot;sensitivity groups\u0026quot; whose members were asked to note their \u0026quot;\u0027\u0027beardism\u0027\u0027\u0026quot; (i.e., beard-racism), or negative associations to facial hair\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Janet Trewin, \u0027Presenting on TV and Radio: An insider\u0027s guide\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"When the Americans first took me on there was great debate about it. They thought it might be seen as shifty or untrustworthy. They said, \u0027Oh he\u0027s got a beard!\u0027; \u0027Well, maybe it\u0027s a European thing\u0027; \u0027Oh hey, that\u0027s OK then\u0027. \u0027\u0027Beardism\u0027\u0027 is rampant\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The period during which one has a beard\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1846\u0027\u0027, William Hughes, \u0027The three students of Gray\u0027s Inn\u0027 (page 172\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the incipient horse guardsman — a tall hobbledehoy just budding into gooseberry \u0027\u0027beardism\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Support for beards; a favourable opinion of beards\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1844\u0027\u0027, William North, ‎Benjamin Disraeli (Earl of Beaconsfield), \u0027Anti-Coningsby; or, The new generation grown old\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"arguments neither wholly for, nor yet entirely against the propagation of \u0027\u0027beardism\", \"priority\":11}]}, \"synonyms\":{}}");

	add("bearer", "{\"term\":\"bearer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|bear|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, bears, sustains, or carries\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bible, 2 Chron. ii. 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Bearers\u0027\u0027 of burdens\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027bearer\u0027\u0027 of unhappy news\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Someone who helps carry the coffin or a dead body during a funeral procession; pallbearer\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"One who possesses a cheque, bond, or other notes promising payment\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I promise to pay the \u0027\u0027bearer\u0027\u0027 on demand\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A domestic servant or palanquin carrier\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, Rudyard Kipling, ‘Watches of the Night’, \u0027Plain Tales from the Hills\u0027, Folio 2005, p. 60\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The bar of the watch-guard worked through the buttonhole, and the watch—Platte\u0027s watch—slid quietly on to the carpet; where the \u0027\u0027bearer\u0027\u0027 found it next morning and kept it\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A tree or plant yielding fruit\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"a good \u0027\u0027bearer\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A strip of reglet or other furniture to bear off the impression from a blank page\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A type or type-high piece of metal interspersed in blank parts to support the plate when it is shaved\", \"priority\":15}]}, \"synonyms\":{}}");

